swaptrade_modal_desc_crosschain_valuedif:
الرسوم التي تؤخذ في الاعتبار في فرق القيمة لعقد المبادلة العابر للشبكات هي:
• رسوم الجسر العابر للشبكات: {bridgePriceAndFee}
• رسوم الشبكة على الشبكة الوجهة: {toChainPriceAndFee}
• عند تداولك على مبلغ معين من العملات الرمزية، فإن ذلك يؤثر على عمق مجمع السيولة. وهذا بدوره يعمل على تغيير التوافر العام وأسعار العملات الرمزية، ما يؤدي إلى اختلافات جوهرية في الأسعار.

swaptrade_mid_dialog_desc_est_network_fe:
في المعاملات العابرة للشبكات، تتضمن هذه الرسوم رسوم الشبكة الخاصة بشبكة عملة الدفع الرمزية والجسر العابر للشبكات.

وتتكون رسوم هذه المعاملة من:
· رسوم الشبكة الخاصة بـ {chain}: {value1}
· رسوم الشبكة الخاصة بـ {bridge}: {value2}

لا نفرض رسومًا على الشبكة لأنها تُعتَبر مدفوعات للمُعَدِّنين.

swaptrade_intro_dialog_desc_cross_value_:
يظهر فرق قيمة هذه المعاملة على النحو التالي:
· {chain} رسوم شبكة سلسلة: {value1}
· {bridge} رسوم جسر: {value2}

إذا كان فرق القيمة أكبر بكثير، بينما تكون الرسوم المدرجة أعلاه قليلة نسبيًا، يرجع ذلك إلى أن مبلغ عقد المبادلة قد أثر على عمق مجمع السيولة لهذا الزوج من العملات الرمزية.

swaptrade_intro_tooltip_trade_including_:
